import React from 'react';
import { Card } from 'antd';
import './App.css';

class CurrencyCard extends React.Component {

    constructor(props) {
        super(props);
        this.state = {
            buy: 0.0,
            sell: 0.0
          };
      }

    componentDidMount() {
        const req = new Request("http://localhost:8080/getgemini?currencyType="+this.props.type, {
            method: 'GET',
            cache: 'default'
          });
    fetch(req,
    {
        headers : { 
          'Content-Type': 'application/json',
          'Accept': 'application/json'
         }

      })
      .then((response) => {
          return response.clone().json()
        }
          )
      .then((data) => {
        this.setState({
                buy: data["Buy"],
                sell: data["Sell"]
            });
        })

    }

    render() {
        const { buy, sell } = this.state

            return (
            <div className="insideCard">
                <Card title={this.props.type}>
                    <p>
                    <br />
                            <b>BUY:</b>{buy} 

                            <br />
                            <b>SELL:</b>{sell}

                    </p>
                </Card>
            </div>
            );
            }
    }

export default CurrencyCard;
